"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Panic disorder (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/panic-disorder-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H8300424\">",
"      <span class=\"h1\">",
"       What is panic disorder?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Panic disorder is a condition that can make a person feel very scared and anxious for short periods of time. When this happens, it is called a &ldquo;panic attack.&rdquo; The attacks can also cause chest pain and breathing problems that cause people to visit doctors or emergency rooms.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H8300439\">",
"      <span class=\"h1\">",
"       What are the symptoms of panic disorder?",
"      </span>",
"      &nbsp;&mdash;&nbsp;People with panic disorder have panic attacks that can make them:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Feel very scared and nervous",
"       </li>",
"       <li>",
"        Have physical symptoms such as:",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"hyphen-block\">",
"       <li>",
"        Chest pain",
"       </li>",
"       <li>",
"        Trouble breathing",
"       </li>",
"       <li>",
"        A fast heartbeat",
"       </li>",
"       <li>",
"        Headache",
"       </li>",
"       <li>",
"        Stomachache",
"       </li>",
"       <li>",
"        Dizziness",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      The attacks happen without warning and can last several minutes to an hour.",
"     </p>",
"     <p>",
"      People with panic disorder also:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Worry about having panic attacks in the future",
"       </li>",
"       <li>",
"        Avoid situations that might cause them to have a panic attack",
"       </li>",
"       <li>",
"        Often see doctors or go to emergency rooms when they have panic attacks",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H8300454\">",
"      <span class=\"h1\">",
"       Is there a test for panic disorder?",
"      </span>",
"      &nbsp;&mdash;&nbsp;No. There is no test. But your doctor or nurse should be able to tell if you have it by learning about your symptoms. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H8300469\">",
"      <span class=\"h1\">",
"       How is panic disorder treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatments include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Cognitive behavioral therapy (CBT) - In this type of therapy, you talk with a psychologist or counselor about the things you think and do. Then he or she helps you change how you think about your situation and how you react to it. This teaches you how to cope better with your panic disorder.",
"       </li>",
"       <li>",
"        Medicines &ndash; Some medicines used to treat depression or anxiety can help people with panic disorder. Your doctor or nurse will decide which medicines are best for your situation.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Some people have CBT and also take medicines.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H8300484\">",
"      <span class=\"h1\">",
"       What if I want to get pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If you take medicines to treat panic disorder, talk to your doctor before you start trying to get pregnant. Some of the medicines used to treat panic disorder can cause problems for unborn babies, so you might need to switch medicines before you get pregnant.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H8300499\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"UTD.htm?31/32/32257?source=see_link\">",
"       Patient information: Generalized anxiety disorder (The Basics)",
"      </a>",
"     </p>",
