"    </p>",
"    <p>",
"     <a class=\"medical medical_basics\" href=\"UTD.htm?29/40/30338?source=see_link\">",
"      Patient information: Lyme disease (The Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_basics\" href=\"UTD.htm?14/51/15155?source=see_link\">",
"      Patient information: Insect bites and stings (The Basics)",
"     </a>",
"     <br/>",
"     <a class=\"medical medical_basics\" href=\"UTD.htm?22/2/22562?source=see_link\">",
