var title_f13_10_13483="Recommendations routine TBNA";
var content_f13_10_13483=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F73427&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F73427&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=5\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Recommendations for the routine performance of TBNA",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        All patients presenting with mediastinal or hilar adenopathy or both should have 22G and/or 19G TBNA performed as the initial procedure. These results should provide a diagnosis of both malignant and nonmalignant diseases, as well as help in the staging of lung cancers.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        In patients with visible endobronchial disease, 22G TBNA should be performed in case of a necrotic or a hemorragic tumor, or in a patient with a bleeding diathesis.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        All patients with evidence of submucosal and peribronchial disease should have 22G needle cytology sampling.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        TBNA should be the initial diagnostic procedure in all patients with peripheral lesions which extrinsically compress the bronchus but do not invade the lumen.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from Dasgupta A, Mehta AC, Clin Chest Med 1999; 20:39 and Minai, OA, Dasgupta, A, Mehta, AC. Transbronchial needle aspiration of central and peripheral lesions. In: Bolliger, CT, Mathur, PN (Eds), Progress in Respiratory Research-Interventional Bronchoscopy. Karger, Basel, Switzerland, 1999.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
