var title_f13_10_13484="Pulmonary allograft rejection";
var content_f13_10_13484=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F61800&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F61800&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Classification and grading of pulmonary allograft rejection",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        A: Acute rejection*: characterized by perivascular and interstitial mononuclear cell infiltrates",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Grade 0: none",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Grade 1: minimal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Grade 2: mild",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Grade 3: moderate",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Grade 4: severe",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        B: Airway inflammation (lymphocytic bronchiolitis)*: characterized by mononuclear cell infiltrates in the submucosa of bronchioles",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Grade 0: none",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Grade 1R",
"        <sup>",
"         &bull;",
"        </sup>",
"        : low grade",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Grade 2R",
"        <sup>",
"         &bull;",
"        </sup>",
"        : high grade",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Grade X: ungradeable",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        C: Chronic airway rejection (obliterative bronchiolitis): manifest by fibrous scarring that is often dense and eosinophilic",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        0: absent",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        1: present",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        D: Chronic vascular rejection - accelerated graft vascular sclerosis: characterized by fibrointimal thickening of the pulmonary arteries and veins. These lesions are not seen on TBB as they affect larger blood vessels than those accessed with TBB.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     TBB: transbronchial biopsy.",
"     <br/>",
"     * Acute vascular rejection (A1 to A4) and acute airway inflammation (B1 to B2R) can be seen independently or may both be present.",
"     <br/>",
"     <span class=\"bullet\">",
"      &bull;",
"     </span>",
"     \"R\" denotes revised grade to avoid confusion with 1996 scheme.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Stewart S, Fishbein MC, Snell GI, et al. Revision of the 1996 working formulation for the standardization of nomenclature in the diagnosis of lung rejection. J Heart Lung Transplant 2007; 26:1229. Table used with the permission of Elsevier Inc. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
